  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Litchfield
  Wetland Management District outlines District accomplishments during the 1982 calendar
  year. The report begins with a summary of the year's highlights and weather conditions.
  Land acquisition is covered. The report includes a planning section which discusses
  the master plan and management planning. WMD administration is outlined; information
  about personnel, youth programs, volunteer programs, funding, safety, and technical
  assistance is given. Habitat management is also covered; subjects include wetlands,
  croplands, grasslands, grazing, haying, fire management, pest control, water rights,
  and WPA easements. The wildlife section of the report discusses wildlife diversity,
  endangered and threatened species, waterfowl, marsh birds and waterbirds, and game
  mammals. The public uses of the WMD described in this report include interpretive
  programs, hunting, fishing, trapping, outdoor recreation, and law enforcement. The
  equipment and facilities section of the report provides information about new construction,
  rehabilitation, major maintenance, equipment replacement, communication systems,
  and energy conservation. Cooperative programs and items of interest are provided
  at the end.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
